  <style>
	.box {
	    position: relative;
	}
	.peoplekun_rightdown{
	  position:fixed;
	  bottom:-50px;
	  right:0px;
	  height:20vh;
	  cursor: pointer;
	}
	.peoplekun_leftdown{
	  position:fixed;
	  bottom:-50px;
	  left:0px;
	  height:20vh;
	  cursor: pointer;
	}
	.peoplekun_rightup{
	  position:fixed;
	  transform:rotate(180deg);
	  top:-50px;
	  right:0px;
	  height:20vh;
	  cursor: pointer;
	}
	.peoplekun_leftup{
	  position:fixed;
	  transform:rotate(180deg);
	  top:-50px;
	  left:0px;
	  height:20vh;
	  cursor: pointer;
	}
	.peoplekun_center{
	  position:fixed;
	  top: 30px;
	  left: 20px;
	  right: 0px;
	  bottom: 0px;
	  margin: auto;
	  width:22vh;
	  pointer-events: auto;
	  cursor: pointer;
	}
	.egg{
	  position:fixed;
	  top: 0;
	  left: 0;
	  right: 0;
	  bottom: 0;
	  margin: auto;
	  width:100vh;
	}
	.balloon {
	 position: fixed;
	 padding: 10px;
	 top: -22vh;
	 left: -22vh;
	 right: 0vh;
	 bottom: 0vh;
	 margin: auto;
	 width: 10vh;
	 height: 10vh;
	 line-height: 10vh;
	 border-radius: 50%;
	 text-align: center;
	 color: #ffffff;
	 letter-spacing: 0.1em;
	 font-size: 2vh;
	 background-color: #000000;
	 visibility:visible;
	}
	.balloon::before {
	 content: '';
	 position: absolute;
	 width: 0;
	 height: 0;
	 right: 2px;
	 bottom: 2px;
	 border-left: 20px solid #000000;
	 border-top: 10px solid transparent;
	 border-bottom: 10px solid transparent;
	 transform: rotate(45deg);
	}
  </style>
